"""
Встроенные ресурсы приложения (иконки) в base64.
Загрузка без привязки к физическим файлам.
"""
import base64
from PyQt6.QtGui import QIcon, QPixmap, QImage
from PyQt6.QtCore import QByteArray

# Иконка приложения (icon.ico) в base64 — вставьте сюда свой base64
ICON_BASE64 = ""

# SVG в base64 (из resources/assets)
SVG_BASE64 = {
    "check": "",
    "close": "",
    "chevron-down": "",
    "chevron-right": "",
    
}


def get_svg_data_url(name: str) -> str:
    """Возвращает data URL для SVG (для использования в QSS: image: url(...))."""
    b64 = SVG_BASE64.get(name)
    if not b64:
        return ""
    return f"data:image/svg+xml;base64,{b64}"


def get_svg_bytes(name: str) -> bytes:
    """Возвращает байты SVG для QSvgRenderer.load(QByteArray)."""
    b64 = SVG_BASE64.get(name)
    if not b64:
        return b""
    return base64.b64decode(b64)


def get_svg_qbytearray(name: str) -> QByteArray:
    """Возвращает QByteArray SVG для QSvgRenderer."""
    return QByteArray(get_svg_bytes(name))


def get_app_icon() -> QIcon:
    """Иконка приложения (окно, трей, диалоги). Загружается из base64."""
    if not ICON_BASE64:
        return QIcon()
    try:
        data = base64.b64decode(ICON_BASE64)
        pix = QPixmap()
        if pix.loadFromData(QByteArray(data)):
            return QIcon(pix)
        img = QImage()
        if img.loadFromData(QByteArray(data)):
            return QIcon(QPixmap.fromImage(img))
    except Exception:
        pass
    return QIcon()
